textOriginal:
Iriam votar no Bozo porque ele era família, aí descobriram que ele teve um filho fruto de uma traição;
Iriam votar no Bozo porque ele é contra o aborto, aí descobriram que ele deixou a decisão de abortar esse filho, fruto de traição, para a amante;
Iriam votar no Bozo porque ele é cristão, aí descobriram que ele  frequentou a maçonaria;
Iriam votar no Bozo porque ele era honesto, descobriram que ele ensinou sua família como se faz rachadinha, "corrompeu toda a família"( Ciro Gomes);
Iriam votar no Bozo porque ele é sensato, aí descobriram que ele queria comer carne humana;
Iriam votar no Bozo porque ele protege as criancinhas, descobriram... ( essa deixa a história contar)
Reginaldo
